import women from './herosectionimages/womenwear.png';
import menwear from './herosectionimages/menwear.png';
import winter from './herosectionimages/wintercollection.png';
import hooded from './herosectionimages/hoddie.png';
import poloneck from './herosectionimages/poloneck.png';


const Categorydata = [
    {
        imgsrc:{menwear},
        title:'Men’s T-Shirts'
    },
    {
        imgsrc:{women},
        title:'Women’s Wear'
    },
    {
        imgsrc:{winter},
        title:'Winter Collections'
    },
    {
        imgsrc:{hooded},
        title:'Hooded T-Shirts'
    },
    {
        imgsrc:{poloneck},
        title:'Polo Neck T-Shirts'
    },
 
]

export default Categorydata;
